import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note" ;
import CreateNote from "./NoteArea";

var noteArray;

function App(){
    function newNote(note){
       console.log(note);
       noteArray = note ;
    }

    return <div><Header />
    <CreateNote addNote = {newNote}/>
    <Note noteArray= {noteArray} />
    <Footer />
    </div> ;
}

export default App;
